import React, { Component } from 'react';
import Search from './components/search';
import UserInfo from './components/user-info';
import Actions from './components/actions';
import Repos from './components/repos';
//import logo from './logo.svg';
import './App.css';
import './css/index.css';

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <div className="app">
        <Search />
        <UserInfo />
        <Actions />
        <Repos
          className="Repos"
          title="Repositórios"
          repos={[
            {
              name: 'Nome do repositório',
              link: '#',
            },
            {
              name: 'Bruno óleo de peroba',
              link: 'peroba.com',
            },
          ]}
        />

        <Repos
          className="Starred"
          title="Favoritos"
          repos={[
            {
              name: 'The name of cuck',
              link: 'briuno',
            },
            {
              name: 'bruno é macaco',
              link: 'wikihow',
            },
          ]}
        />
      </div>
    );
  }
}

export default App;
